import logo from './logo.svg';
import './App.css';
import { render } from '@testing-library/react';

function App() {


  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p id="b"></p>
        <input id="a"></input>
        <button onClick={sayHello()}>Add Info</button>
      </header>
    </div>
  );
}

function sayHello() {
  alert('Hello!');
}

